<html lang="en">

<head>

    <style>
        @import url('https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700&display=swap');

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Inter', sans-serif;
            background: linear-gradient(135deg, #0c0c0c 0%, #1a1a1a 100%);
            color: #fff;
            overflow: hidden;
            user-select: none;
        }

        .video-container {
            position: fixed;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            background: #000;
            z-index: 1;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        video {
            width: 100%;
            height: 100%;
            object-fit: contain;
            background: #000;
        }

        .controls {
            position: fixed;
            bottom: 0;
            left: 0;
            right: 0;
            background: rgba(0, 0, 0, 0.4);
            backdrop-filter: blur(20px);
            -webkit-backdrop-filter: blur(20px);
            border-top: 1px solid rgba(255, 255, 255, 0.1);
            display: flex;
            align-items: center;
            justify-content: space-between;
            padding: 0.75rem 1rem;
            z-index: 10;
            transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
        }

        .controls.hidden {
            opacity: 0;
            transform: translateY(100%);
            pointer-events: none;
        }

        .controls-left,
        .controls-right {
            display: flex;
            align-items: center;
            gap: 0.5rem;
        }

        .control-btn {
            background: rgba(255, 255, 255, 0.1);
            border: 1px solid rgba(255, 255, 255, 0.2);
            color: white;
            cursor: pointer;
            border-radius: 8px;
            transition: all 0.3s ease;
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 0.5rem;
            font-size: 0.8rem;
        }

        .control-btn:hover {
            background: rgba(255, 255, 255, 0.2);
            transform: scale(1.05);
        }

        .play-pause-btn {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            width: 2.5rem;
            height: 2.5rem;
            border-radius: 50%;
            box-shadow: 0 4px 15px rgba(102, 126, 234, 0.4);
            border: none;
            color: white;
            font-size: 0.9rem;
            cursor: pointer;
            transition: all 0.3s ease;
        }

        .play-pause-btn:hover {
            transform: scale(1.05);
            box-shadow: 0 6px 20px rgba(102, 126, 234, 0.6);
        }

        .play-icon,
        .pause-icon {
            width: 16px;
            height: 16px;
            fill: white;
        }

        .time {
            font-size: 0.75rem;
            font-family: 'Inter', monospace;
            min-width: 80px;
            color: white;
            display: none;
        }

        /* YouTube-style Progress Bar */
        .progress-container {
            position: absolute;
            bottom: 4rem;
            left: 1rem;
            right: 1rem;
            height: 6px;
            cursor: pointer;
            z-index: 11;
            transition: all 0.4s ease;
            padding: 8px 0;
        }

        .progress-container.hidden {
            opacity: 0;
            transform: translateY(20px);
            pointer-events: none;
        }

        .progress-track {
            position: relative;
            height: 4px;
            background: rgba(255, 255, 255, 0.2);
            border-radius: 2px;
            transition: height 0.2s ease;
        }

        .progress-container:hover .progress-track {
            height: 6px;
        }

        .progress-buffer {
            position: absolute;
            top: 0;
            left: 0;
            height: 100%;
            background: rgba(255, 255, 255, 0.3);
            border-radius: 2px;
            width: 0%;
            transition: width 0.3s ease;
        }

        .progress-bar {
            position: absolute;
            top: 0;
            left: 0;
            height: 100%;
            background: linear-gradient(90deg, #667eea 0%, #764ba2 100%);
            border-radius: 2px;
            width: 0%;
            transition: width 0.1s ease;
        }

        .progress-thumb {
            position: absolute;
            top: 50%;
            transform: translate(-50%, -50%);
            width: 14px;
            height: 14px;
            background: #fff;
            border-radius: 50%;
            box-shadow: 0 2px 8px rgba(0, 0, 0, 0.3);
            opacity: 0;
            transition: all 0.2s ease;
            cursor: grab;
            z-index: 2;
        }

        .progress-thumb:active {
            cursor: grabbing;
        }

        .progress-container:hover .progress-thumb {
            opacity: 1;
        }

        .progress-thumb.dragging {
            opacity: 1;
            transform: translate(-50%, -50%) scale(1.2);
            box-shadow: 0 4px 12px rgba(102, 126, 234, 0.4);
        }

        /* --- NEW STYLES FOR DOWNLOAD --- */

#downloadButton {
    left: auto; /* override from .back-button */
    right: 1rem;
    display: none; /* Initially hidden */
}

.download-quality-buttons {
    display: grid;
    grid-template-columns: 1fr 1fr;
    gap: 0.75rem;
    margin-top: 1.25rem;
}

.download-quality-btn {
    background: rgba(255, 255, 255, 0.1);
    border: 1px solid rgba(255, 255, 255, 0.2);
    color: white;
    padding: 0.7rem 1rem;
    border-radius: 8px;
    font-size: 0.9rem;
    font-weight: 500;
    cursor: pointer;
    transition: all 0.2s ease;
}

.download-quality-btn:hover {
    background: rgba(255, 255, 255, 0.25);
    transform: translateY(-2px);
}

.download-success-message {
    color: #a7f3d0;
    font-size: 0.95rem;
    margin-top: 1rem;
    line-height: 1.5;
}

/* --- END NEW STYLES --- */

        .back-button {
            position: fixed;

        .back-button:hover {
            background: rgba(0, 0, 0, 0.8);

        .icon {

            height: 16px;
            stroke: white;
            fill: none;
            stroke-width: 2;
            stroke-linecap: round;
            stroke-linejoin: round;

        .skip-text {
            font-size: 0.7rem;
            font-weight: 600;
            color: white;
        }

        .control-select {
            background: rgba(255, 255, 255, 0.1);
            color: white;
            border: 1px solid rgba(255, 255, 255, 0.2);
            border-radius: 8px;
            padding: 0.4rem 1.5rem 0.4rem 0.6rem;
            font-size: 0.7rem;
            cursor: pointer;
            appearance: none;
            background-image: url("data:image/svg+xml,%3csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 24 24' fill='none' stroke='white' stroke-width='2' stroke-linecap='round' stroke-linejoin='round'%3e%3cpolyline points='6 9 12 15 18 9'/%3e%3c/svg%3e");
            background-repeat: no-repeat;
            background-position: right 0.5rem center;
            background-size: 12px;
            min-width: 60px;
        }

        .control-select:hover {
            background-color: rgba(255, 255, 255, 0.2);
        }

        .control-select option {
            background: #1a1a1a;
            color: white;
        }

        .loading {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            z-index: 5;
        }

        .loading-spinner {
            width: 32px;
            height: 32px;
            border: 3px solid rgba(255, 255, 255, 0.3);
            border-top: 3px solid #667eea;
            border-radius: 50%;
            animation: spin 1s linear infinite;
        }

        @keyframes spin {
            100% {
                transform: rotate(360deg);
            }
        }

        .popup-overlay {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.6);
            backdrop-filter: blur(10px);
            z-index: 1000;
            display: none;
            justify-content: center;
            align-items: center;
            padding: 1rem;
        }

        .popup-content {
            background: rgba(25, 25, 25, 0.9);
            border: 1px solid rgba(255, 255, 255, 0.15);
            border-radius: 12px;
            padding: 1.5rem;
            width: 100%;
            max-width: 320px;
            text-align: center;
            backdrop-filter: blur(20px);
        }

        .popup-content h2 {
            font-size: 1.25rem;
            margin-bottom: 0.5rem;
            color: white;
        }

        .popup-content p {
            color: #ccc;
            margin-bottom: 1.25rem;
            font-size: 0.9rem;
        }

        .popup-buttons {
            display: flex;
            flex-direction: column;
            gap: 0.75rem;
        }

        .popup-btn {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            border: none;
            padding: 0.75rem;
            border-radius: 8px;
            font-size: 0.9rem;
            font-weight: 600;
            cursor: pointer;
            transition: transform 0.2s ease;
        }

        .popup-btn:hover {
            transform: scale(1.02);
        }

        .popup-btn.normal {
            background: rgba(255, 255, 255, 0.1);
            border: 1px solid rgba(255, 255, 255, 0.2);
            color: white;
        }

        .popup-btn.normal:hover {
            background: rgba(255, 255, 255, 0.2);
        }

        .mobile-time {
            position: fixed;
            bottom: 4.5rem;
            left: 1rem;
            background: rgba(0, 0, 0, 0.6);
            backdrop-filter: blur(10px);
            padding: 0.25rem 0.5rem;
            border-radius: 4px;
            font-size: 0.7rem;
            font-family: 'Inter', monospace;
            color: white;
            z-index: 12;
            transition: all 0.4s ease;
            display: block;
        }

        .mobile-time.hidden {
            opacity: 0;
            transform: translateY(10px);
            pointer-events: none;
        }

        /* Tablet and Desktop Styles */
        @media (min-width: 640px) {
            .controls {
                padding: 1rem 1.5rem;
            }

            .controls-left,
            .controls-right {
                gap: 1rem;
            }

            .control-btn {
                padding: 0.75rem;

                border-radius: 12px;
            }

            .play-pause-btn {
                width: 3.5rem;
                height: 3.5rem;

            }

            .play-icon,
            .pause-icon {
                width: 20px;
                height: 20px;
            }

            .time {
                display: block;
                font-size: 0.9rem;
                min-width: 140px;
            }

            .mobile-time {
                display: none;
            }

            .progress-container {
                bottom: 5rem;

                height: 8px;
            }

            .progress-track {
                height: 4px;
            }

            .progress-container:hover .progress-track {
                height: 6px;
            }

            .progress-thumb {
                width: 16px;
                height: 16px;
            }

            .back-button {
                top: 1.5rem;
                left: 1.5rem;

                font-size: 0.9rem;
                border-radius: 12px;
            }

            .icon {
                width: 20px;
                height: 20px;
            }

            .skip-text {
                font-size: 0.85rem;
            }

            .control-select {
                padding: 0.6rem 2.5rem 0.6rem 0.8rem;
                font-size: 0.85rem;

                background-position: right 0.8rem center;
                min-width: 80px;
                border-radius: 12px;
            }

            .loading-spinner {
                width: 40px;
                height: 40px;
            }

            .popup-content {
                max-width: 400px;
                padding: 2rem;
                border-radius: 16px;
            }

            .popup-content h2 {
                font-size: 1.5rem;
                margin-bottom: 0.75rem;
            }

            .popup-content p {
                margin-bottom: 1.5rem;
                font-size: 1rem;
            }

            .popup-buttons {
                gap: 1rem;
            }

            .popup-btn {
                padding: 0.8rem;
                font-size: 1rem;
                border-radius: 12px;
            }
        }

        /* Large Desktop Styles */
        @media (min-width: 1024px) {
            .controls {
                padding: 1.5rem 2rem;
            }

            .back-button {
                top: 2rem;
                left: 2rem;
                padding: 1rem 1.5rem;
                font-size: 1rem;
            }

            .progress-container {
                left: 2rem;
                right: 2rem;
            }
        }

        /* Hide speed selector on mobile */
        @media (max-width: 639px) {
            .speed-selector-mobile-hide {
                display: none;
            }
        }

        /* Landscape orientation handling */
        @media screen and (orientation: landscape) and (max-height: 500px) {
            .back-button {
                top: 0.5rem;
                left: 0.5rem;
                padding: 0.4rem 0.6rem;
                font-size: 0.75rem;
            }

                padding: 0.5rem 1rem;
            }

            .progress-container {
                bottom: 3.5rem;
            }

            .mobile-time {
                bottom: 4rem;
            }
        }
    </style>
</head>
